state = {
  nameofcontainer : [ 
    {name:"manish"},
    {name:"vardhan"},
    {name:"cruse"}

  ]
 }

 switchHandler = () => {
  // console.log('was clicked');
  this.setState( {
    nameofcontainer : [ 
      {name:"manish sagar"},
      {name:"vardhan"},
      {name:"cruse vavilala"}

    ]
  } )
 }



  const app = (props) => {
    return (
      <div className = 'App'>
        {/* this is header */}
        <Person  />
        {/* this is header */}

      <button onClick = {this.switchHandler}>switch containers</button>
      {/* <button onClick = {this.state.nameofcontainers}>unswitchcontainers</button> */}
        {/* this is block */}     
      <Container name= {this.state.nameofcontainer[0].name} >this is slider part</Container>
      <Container name= {this.state.nameofcontainer[1].name}>this is slider part</Container>
      <Container name = {this.state.nameofcontainer[2].name}>this is slider part</Container>
        {/* this is block */}


        {/* this is footer */} 
      <Manish />
        {/* this is footer */}
      </div>
    );

}

export default app;
